          <a href="#stacked-covered" className="">
            Talent Pool

            {/*  Menu Item 3*/}
          </a>
          <a href="#faqs" className="">
            About Us
            {/* First Menu Item 4 */}
          </a>
        </div>
      </div>
      {/* large */}
      {/**/}
      <div className="flex items-center ">

        <div className="hidden lg:flex">
          <Button />
        </div>

      </div>

    </div>
  );
};

export default Header;
